$core->db->query("
    SELECT * 
    FROM `s_contracts` 
    WHERE return_date < '2020-01-01'
    ORDER BY inssuance_date DESC
    LIMIT 10
");
$contracts = $core->db->results();

foreach ($contracts as $contract)
{
    $contract_update = array(
        'status' => 2,
        'collection_status' => 0,
        'collection_manager_id' => 0,
    );
    
    $core->db->query("
        SELECT * 
        FROM __operations 
        WHERE contract_id = ?
        AND DATE(created) >= '2022-02-08'
        AND type = 'PAY'
        ORDER BY created DESC
        LIMIT 1
        ", $contract->id);
    $contract->pay_operation = $core->db->result();
    
    
    $new_return_date = date('Y-m-d H:i:s', strtotime($contract->pay_operation->created) + 86400 * 30);
    $max_return_date = date('Y-m-d H:i:s', strtotime($contract->inssuance_date) + 86400*150);
    echo 'новая дата возврата: '.$new_return_date.'<br />';
    echo 'макс дата возврата: '.$max_return_date.'<br />';
    
    if (strtotime($max_return_date) < strtotime($new_return_date))
        $contract_update['return_date'] = $max_return_date;
    else
        $contract_update['return_date'] = $new_return_date;
    
    
    // peni
    $query = $core->db->placehold("
        SELECT * 
        FROM __operations 
        WHERE contract_id = ?
        AND DATE(created) >= ?
        AND type = 'PENI'
        ORDER BY created DESC
        ", $contract->id, $contract->pay_operation->created);
    $core->db->query($query);
//echo __FILE__.' '.__LINE__.'<br /><pre>';var_dump($query);echo '</pre><hr />';
    $contract->peni_operations = $core->db->results();
    
    if (!empty($contract->peni_operations))
    {
        $left_peni = 0;
        foreach ($contract->peni_operations  as $po)
        {
            $left_peni += $po->amount;
        }
        
        echo 'лишние пени: '.$left_peni.'<br />';
        echo 'было: '.$contract->loan_peni_summ.'<br />';
        echo 'стало: '.($contract->loan_peni_summ - $left_peni).'<br />';
        
        $contract_update['loan_peni_summ'] = $contract->loan_peni_summ - $left_peni;
        
        echo 'Удаляем пени... <br />';
        foreach ($contract->peni_operations  as $po)
        {
            $core->operations->delete_operation($po->id);
        }
        
    }
    
    $core->contracts->update_contract($contract->id, $contract_update);
    
    echo __FILE__.' '.__LINE__.'<br /><pre>';var_dump($contract_update, $contract);echo '</pre><hr />';
}

